import { Link } from "react-router-dom";

export function Navbar() {
  return (
    <div className="NAV">
      <Link to="/">E-COM</Link>
      <ul>
        <Link to="/login">Login</Link>
        <Link to="/user">User</Link>
        <Link to="/cart">Cart</Link>
      </ul>
    </div>
  );
}
